import React,{useEffect} from "react";
import imageApi from "../../common/apis/imageApi";
import {APIKey} from "../../common/apis/imageApiKey";
import ImageCard from "../ImageCard/ImageCard";
import { useDispatch, useSelector } from "react-redux";
import {addImages, getAllImages} from "../../features/Images/imageSlice";

const Tree = () => {
    const title="tree";
    const dispatch = useDispatch();
    useEffect(()=>{
        const fetchTitle = async () =>{
            const response =  await imageApi.get(`?key=${APIKey}&q=${title}&image_type=photo`)
            .catch((err) =>{
                console.log("Err :",err);
            });
            dispatch(addImages(response.data));
        };
        fetchTitle();
    },[dispatch]);

    const images = useSelector(getAllImages);
    let renderImages= "";

    renderImages =
    images.Response === "True" ? (
      images.Search.map((image, index) => (
        <ImageCard key={index} data={image} />
      ))
    ) : (
      <div>
        <h3>{images.Error}</h3>
      </div>
    );
    return (
        <div>
            <div className="movie-container">{renderImages}</div>Hi
        </div>
    );
};

export default Tree;
